import React, { Component } from 'react';
import {Container, Row, Col, Button} from 'react-bootstrap';

class StartOptions extends Component {
  constructor(props){
    super(props)

    this.signUp = this.signUp.bind(this)
    this.login = this.login.bind(this)
  }

  changView(view) {
    this.props.parent.setState({
      index: view
    })
    console.log("ddfef")
  }

  signUp(){
    console.log("djdjdjdjdjd")
    this.changView("SignUp")
  }

  login(){
    this.changView("Login")
  }
  render(){
    return(
      <Row>
      <Col>
        <div>
          <p>SIMPLE.</p>
          <p>QUICK.</p>
          <p>SECURE.</p>
        </div>
        <Button variant="outline-dark" onClick={this.signUp}>signup</Button>
        <Button variant="outline-dark" onClick={this.login}>login</Button>
        </Col>
      </Row>
    )
  }
}

export default StartOptions
